            if (arr[i] != s2.charAt(ind)) cnts[1]++;
            if (arr[i] != s3.charAt(ind)) cnts[2]++;
        }
        int ans = Math.min(Math.min(cnts[0], cnts[1]), cnts[2]);
        for(int i = K; i < N; i++) {
            int ind = (K-1)%3;
