		int[] steps = new int[max + 1];

		for (int i = 2; i <= max; i++) {
			int ones = numberOfOnes(i);
			steps[i] = 1 + steps[ones];
		}

		if (l <= 10) {
			int ans = 0;
			for (int i = 1; i <= max; i++) {
				if (steps[i] == k) {
					ans++;
				}
			}
			System.out.println(ans);
		} else {
			int[][] C = binomial(max);

			int ans = 0;
			int count = 0;

			for (int i = 0; i < l; i++) {
				if (n.charAt(i) == '1') {
					for (int j = count; j < max; j++) {
						if (steps[j] == k - 1) {
							ans = (ans + C[l - i - 1][j - count]) % mod;
							if (i == 0 && k == 1) {
								ans = (ans + mod - 1) % mod;
							}
						}
					}
					count++;
				}
			}

			int ones = 0;
			for (int i = 0; i < l; i++) {
				if (n.charAt(i) == '1') {
					ones++;
				}
			}
			if (steps[ones] == k-1) {
				ans = (ans + 1) % mod;
			}

			System.out.println(ans);
		}
	}
}

