	int max = -1;
	for(int i = 0; i < n; ++i) {
		int x = in.nextInt();
		dq.add(x);
		max = Math.max(max, x);
	}
	ArrayList<Pair> ans = new ArrayList<>();
	while(dq.peekFirst() != max) {
		int a = dq.pollFirst();
		int b = dq.pollFirst();
		ans.add(new Pair(a, b));
		if(a > b) {
			dq.addFirst(a);
			dq.addLast(b);
		}
		else {
			dq.addFirst(b);
			dq.addLast(a);
		}
	}
	ArrayList<Integer> a = new ArrayList<>();
	dq.pollFirst();
	for(int x : dq)
		a.add(x);
	while(q --> 0) {
