		if(n%2 == 0){
			array[n] = array[n+1] - (previous - array[n]);
		}
		else{
			array[n] = array[n+1] + (previous - array[n]);
		}
		previous = temp;
		max = Math.min(max, array[n]);
	}
	if(max>=-1){
