      inB[i[1]] = swap;
      in.remove(a-i[0]);
    } else ok = false;
  }

  // write to out
  StringBuffer p = new StringBuffer();
  for (int i=0;i<n-1;i++) {
    p.append(inB[i]);
    p.append(" ");
  }
  p.append(inB[n-1]);
  if (ok) {
    out.println("YES");
    out.println(p.toString());
  } else {
    out.println("NO");
  }

  // cleanup
  out.close();
  System.exit(0);
}

