			sum1 += n[i];
			if (sum1 >= P) sum1 -= P;
			sum2 -= n[i];
			if (sum2 < 0) sum2 += P;
			final int s = sum1 + sum2;
			if (s > max) max = s;
		}
		System.out.println(max);
	}
	catch (IOException e) {
