    private static int fromLetters( String s ) {
        int r = 0;
        int l = s.length();
        for ( int i = 0; i < l; i ++ ) {
            r = r * 26 + s.charAt( i ) - 'A';
        }
        r ++;
        for ( int i = 1, c = 26; i < l; i ++, c *= 26 ) {
            r += c;
        }
        return r;
    }

    private static String toLetters( String s ) {
        int x = new Integer( s ) - 1;
        int c = 26;
        int l = 1;
        while ( true ) {
            if ( x < c ) {
                String r = "";
                for ( int i = 0; i < l; i ++ ) {
                    r = ( char ) ( 'A' + x % 26 ) + r;
                    x /= 26;
                }
                return r;
            }
            x -= c;
            c *= 26;
            l ++;
        }
    }

    private static boolean isNumber( String s ) {
        try {
            int x = new Integer( s );
