            total++;
            indexes.put(c, i);
            tree.add(i);
        }
        else{
            int old = indexes.get(c);
            indexes.put(c, i);
            tree.remove(old);
            tree.add(i);
        }

        if(total == number){
            int dist = tree.last() - tree.first() + 1;
            min = Math.min(dist, min);
        }
    }

    System.out.println(min);
}

