	{
		long mid = (lb+ub)/2;
		long s = ((mid-1)*(mid-2))/2;
		if(n - (sum-s+1) < 0)
			lb = mid;
		else
			ub = mid;
	}

	long rem = n - (sum - ((ub-1)*(ub-2))/2 + 1);
	long res = k - ub + 1;
