            long first = ((mid * (2 + (2 + (mid - 1)))) / 2) - (mid - 1);
            long last = ((mid * (k - mid + 1 + k)) / 2) - (mid - 1);                
            if (n < first) {
                hi = mid;
            } else {
                if (n >= first && n <= last) {
                    hi = mid;
                    best = min(best, (int) mid);
                } else
                    lo = mid + 1;
            }
        }
        System.out.println(best);
    }
}

