    int grown = 4;
    while (init < target) {
        init += grown;
        steps++;
        if (steps >= min) {
            for (i = 0; i < 4; i++) {
                if (steps > to_sides[i]) {
                    init -= after_pass[i];
                    after_pass[i] += 2;
                }
                if (steps >= to_corners[i]){
                    init += corner_share[i]++;
                    //corner_share[i]++;
                }
            }
        }
        grown += 4;
    }
    System.out.println(steps);
