            res += invert.read(n+5)-invert.read(arr[i]);
            res %= MOD;
            invert.update(arr[i], 1);
            has[arr[i]] = true;
        } else num1++;
    }
    if(num1 == 0) {
        System.out.println(res);
        return;
    }
    for(int i = 1; i <= n; i++) if(!has[i]) neg.update(i, 1);
    long invertNum1 = modInv(num1, MOD);
