        if(arr[i] == -1) {
            cnt++;
            continue;
        }
        res += (((neg.read(n+5)-neg.read(arr[i]))*cnt)%MOD)*invertNum1;
        res %= MOD;
    }
    cnt = 0;
    for(int i = n-1; i >= 0; i--) {
        if(arr[i] == -1) {
            cnt++;
            continue;
        }
