        if ( li >= 0 && ri >= 0 )
        {
            sides.remove( li );
            sides.remove( li );
        }
        else if ( li >= 0 )
            sides.set( li, r );
        else if ( ri >= 0 )
            sides.set( ri, l );
        else
        {
            sides.add( -li - 1, r );
            sides.add( -li - 1, l );
        }
    }

    int possibilities = 2;
    for ( int x = 1; x < sides.size() - 1; x += 2 )
        if ( sides.get( x + 1 ) - sides.get( x ) > side )
            possibilities += 2;
        else if ( sides.get( x + 1 ) - sides.get( x ) == side )
            possibilities += 1;

    System.out.println( possibilities );
