                int s = k1 - k2;
                int con = len.get(s);
                if (con == 1) len.remove(s);
                else len.put(s, con - 1);
                len.put((k1 - x), len.getOrDefault((k1 - x), 0) + 1);
                len.put((x - k2), len.getOrDefault((x - k2), 0) + 1);
                length.add(x);
            }
