				}
			}
			if(next1 != null) {
				if(ok(curr, next1.negate())) {
					support.add(curr.subtract(next1));
					vectors.remove(next1);
					continue;
				}
			}
			if(next2 != null) {
				if(ok(curr, next2)) {
					support.add(curr.add(next2));
