			if(val==null) val = 0L;
			count.put(key, val+1);
		}

		long num = n;
		long ans = num*(num+1)/2;

		for(Map.Entry<Long, Long> ent: count.entrySet()){

			Long cnt = ent.getValue();

			long num1 = cnt/2;
			long num2 = (cnt+1)/2;

			ans -= ( (num1*(num1-1))/2 );
			ans -= ( (num2*(num2-1))/2 );
		}

		System.out.println(ans);
	}

