		boolean hit = false;
		double maxY = 0;
		for(int j = 0; j < i; j++) {
			int dx = Math.abs(x[i] - x[j]);
			if(dx == 2*r) {
				if(y[j] > maxY) {
					maxY = y[j];
					hit = true;
				}
