				double newY = y[j] + Math.sqrt(hypSq - dx*dx);
				if(newY > maxY) {
					maxY = newY;
					hit = true;
				}
			}
		}
		if(!hit) {
			y[i] = r;
		} else {
			y[i] = maxY;
		}
	}
	StringBuffer s = new StringBuffer("");
