            Node next = ts.higher(new Node(sum,var.r+1,0));

            if(max>1+next.nb){
                var.nb = max;
                var.ini = m;
            }
            else if(next.ini==null){

                var.nb = 1 + next.nb;
                var.next = next;
                if(max<var.nb){
                    max = var.nb;
                    m = var;
                }


            }else{

                var.nb = 1 + next.nb;
                var.next = next.ini;
                if(max<var.nb){
                    max = var.nb;
                    m = var;
                }

            }


            var = ts.lower(var);

            //System.out.println(sum+" "+var.sum);
        }


    }

    int k = 0;
    Node best = new Node(minvalue,0,0);

    //var = new Node(minvalue,0,0);
    for(Node var:ts){
        if(k<var.nb){
            k = var.nb;
            best = var;
            if(var.ini!=null) best = var.ini;
        }
    }

    if(k==0) System.out.println("erreur");
    else{

        out.println(k);
        sum = best.sum;
        while(best.sum==sum){
            out.println(best.l+" "+best.r);
            best = best.next;
        }

    }


    out.flush();

}

