		if (a == 0) {
			break;
		}
		if (a >= b) {
			cnt += a / b;
			a = a % b;
		} else {
			if (b % a == 0) {
				cnt += b / a - 1;
				b = a;
			} else {
				cnt += b / a;
				b = b % a;					
			}
		}
	}
	out.println(cnt);
