	a = a % b;
	while(true){
		if (a <= 1 || b <= 1) break;
		c = b - a;
		b = a;
		a = c;
		count++;
		if (a > b) count += a / b;
		a = a % b;
	}
	if (b > 1) count += b;
	System.out.println(count);	
