	for (int i = 0; i < temp2.length - 1; i+=2) {
		x = Integer.valueOf(temp2[i]);
		y = Integer.valueOf(temp2[i + 1]);
		visited[x][y] = true;
		qX.add(x);
		qY.add(y);
	}

	while (!qX.isEmpty()) {
		x = qX.poll();
		y = qY.poll();
		if (x >= 2 && !visited[x - 1][y]) {
			visited[x - 1][y] = true;
			qX.add(x - 1);
			qY.add(y);
		}
		if (x + 1 <= n && !visited[x + 1][y]) {
			visited[x + 1][y] = true;
			qX.add(x + 1);
			qY.add(y);
		}
