	int m = in.nextInt();
	int[][] seen = new int[n][m];
	for(int i=0; i<n; i++)
		Arrays.fill(seen[i], -1);
	Queue<Integer> q = new LinkedList<Integer>();
	int k = in.nextInt();
	for(int i=0; i<k; i++) {
		int x = in.nextInt()-1;
		int y = in.nextInt()-1;
		q.add(x);
		q.add(y);
		q.add(0);
		seen[x][y] = 0;
	}
	while(!q.isEmpty()) {
		int x = q.poll();
		int y = q.poll();
		int t = q.poll();
		for(int i=0; i<dx.length; i++) {
			int nx = x + dx[i];
			int ny = y + dy[i];
