							* comb(fTotal + 1 - fB, nS - nBR) % MOD;
					dp[fG + 1][fB - nBR + nGSize - nS] = (dp[fG + 1][fB - nBR + nGSize - nS] + nW) % MOD;
				}
			}
		}
