		for (int i = 0; i < n; i++) {
			for (int j = 0; j < m; j++) {
				dp[w][i][j] = (int) 1e9;
				if (i + 1 < n)
					dp[w][i][j] = Math.min(dp[w][i][j], 2 * costDown[i][j] + dp[w - 2][i + 1][j]);
