			edges[i] = val;
		}

		int h = n/2;

		int[] cliques = new int[1<<h];
		for (int i = 1; i < 1<<h; i++)
		{
			int nodes = i;
			for (int j = 0; j < h; j++)
				if((i & (1 << j)) != 0)
					nodes &= edges[j];
			if(nodes == i)
				cliques[i] = Integer.bitCount(i);
		}

		for (int i = 1; i < 1<<h; i++)
			for (int j = 0; j < h; j++)
