                    curCovered |= (curMask >> 1);
                    curCovered |= (ALL_BITS & (curMask << 1));

                    int curUncovered = ALL_BITS ^ curCovered;
                    dp[r+1][curUncovered][curMask] = Math.min(dp[r+1][curUncovered][curMask], dp[r][uncovered][mask] + Integer.bitCount(curMask));
                }
            }
        }
    }

