        for (int j = 0; j < n; j++) {
            if (i == j) continue;
            long min = Long.MAX_VALUE;
            for (int k = 0; k < m; k++) min = Math.min(min, Math.abs(grid[i][k] - grid[j][k]));
            mn1[i][j] = min;
        }
    }
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            if (i == j) continue;
            long min = Long.MAX_VALUE;
            for (int k = 0; k < m - 1; k++) min = Math.min(min, Math.abs(grid[i][k] - grid[j][k + 1]));
            mn2[i][j] = min;
        }
    }
    long [][] dp = new long[1 << n][n];

