            int i = bitLoc[Integer.lowestOneBit(smask)];
            for (int ss = mask ^ 1 << i; ss > 0; ss &= ss - 1) {
                int j = bitLoc[Integer.lowestOneBit(ss)];
                if (mask == (1 << i ^ 1 << j))
                    dp[mask][i][j] = maxDist[i][j];
                else {
